import axios from "axios";
import Select from "react-select";
import { Form, FormItem, Modal } from "react-native-form-component";
import React, {
  useLayoutEffect,
  useEffect,
  useState,
  useContext,
  useCallback,
} from "react";
import {
  ScrollView,
  StatusBar,
  Button,
  ImageBackground,
  Text,
  View,
  Image,
  TouchableHighlight,
  TextInput,
  SafeAreaView,
  StyleSheet,
  FlatList,
} from "react-native";
import styles from "./styles";
import { Picker } from "@react-native-picker/picker";
//import { categories } from "../../data/dataArrays";
import { getNumberOfRecipes } from "../../data/MockDataAPI";
import MenuImage from "../../components/MenuImage/MenuImage";
import Ip from "../../Ip";
import NativeUploady, {
  UploadyContext,
  useItemFinishListener,
  useItemStartListener,
  useItemErrorListener,
} from "@rpldy/native-uploady";
import { RollInRight } from "react-native-reanimated";

export default function AjouterAnnonceScreen(props) {
  /*/
  const options = [
    { value: 'chocolate', label: 'Chocolate' },
    { value: 'strawberry', label: 'Strawberry' },
    { value: 'vanilla', label: 'Vanilla' }
  ]
  /*/
  //
  let pickerGeneratorCat = (dblist) =>
    dblist.map((i) => {
      return <Picker.Item key={i} label={i.libelle.toString()} value={i.id} />;
    });
  let pickerGeneratorMem = (dblist) =>
    dblist.map((i) => {
      return <Picker.Item key={i} label={i.login.toString()} value={i.id} />;
    });
  let pickerGeneratorCom = (dblist) =>
    dblist.map((i) => {
      return <Picker.Item key={i} label={i.contenue.toString()} value={i.id} />;
    });
  let pickerGeneratorType = (dblist) =>
    dblist.map((i) => {
      return <Picker.Item key={i} label={i.libelle.toString()} value={i.id} />;
    });
  const [selectedValue, setSelectedValue] = useState("java");
  //
  const { ip } = Ip();
  const { navigation } = props;
  const [categories, setCategories] = useState([]);
  const [cat, setCat] = useState([]);
  const [mem, setMem] = useState([]);
  const [com, setCom] = useState([]);
  const [type, setType] = useState([]);
  const loadd = () => {
    async function f() {
      axios
        .get("http://" + ip + "/api/lista")
        .then(function (response) {
          setCat(response.data.cat);
          setMem(response.data.mem);
          setCom(response.data.com);
          setType(response.data.type);
        })
        .catch(function (error) {
          // handle error
          alert(error.message);
        });
    }
    f();
  };
  const [membre_id, setmembre_id] = useState("2");
  const [type_annonce_id, settype_annonce_id] = useState("2");
  const [categorie_annonce_id, setcategorie_annonce_id] = useState("2");
  const [commentaire_id, setcommentaire_id] = useState("2");

  const [titre, setTitre] = useState("titre");
  const [texte, setTexte] = useState("texte");
  const [nbr_vue, setNbrVue] = useState("100000");

  const [etat, setEtat] = useState("etat");
  const [img, setImg] = useState("Img");
  const [classement, setClassement] = useState("10");

  const [visible, setVisible] = useState("1");
  const [publie, setPublie] = useState("1");
  const [photosArray, setphotosArray] = useState("photosArray");

  //
  const Upload = () => {
    const [uploadUrl, setUploadUrl] = useState(false);
    const uploadyContext = useContext(UploadyContext);
    const pickFile = useCallback(async () => {
      try {
        console.log("click !!!! ");
        /*  console.log(categorie_annonce_id);
     console.log(classement);
     console.log(commentaire_id);*/
        axios
          .post("http://" + ip + "/api/annonces", {
            membre_id: membre_id,
            type_annonce_id: type_annonce_id,
            categorie_annonce_id: categorie_annonce_id,
            commentaire_id: commentaire_id,
            titre: titre,
            texte: texte,
            nbr_vue: nbr_vue,
            etat: etat,
            classement: classement,
            visible: visible,
            publie: publie,
            photosArray: "photosArray",
          })
          .then(function (response) {
            alert(response.data);
          })
          .catch(function (error) {
            //alert(response.message);
            alert(error);
          });
      } catch (err) {
        console.log(err);
      }
    }, []);

    return (
      <View>
        <Button title="Choose File" onPress={pickFile} />
      </View>
    );
  };
  //

  useEffect(() => {
    loadd();
  }, []);

  /************* */
  useLayoutEffect(() => {
    navigation.setOptions({
      headerTitleStyle: {
        fontWeight: "bold",
        textAlign: "center",
        alignSelf: "center",
        flex: 1,
      },
      headerLeft: () => (
        <MenuImage
          onPress={() => {
            navigation.openDrawer();
          }}
        />
      ),
      headerRight: () => <View />,
    });
  }, []);

  const onPressCategory = (item) => {
    const title = item.name;
    const category = item;
    navigation.navigate("RecipesList", { category, title });
  };

  const renderCategory = ({ item }) => (
    <TouchableHighlight
      underlayColor="rgba(73,182,77,0.9)"
      onPress={() => onPressCategory(item)}
    >
      <Text style={styles.categoriesName}>{item.libelle}</Text>
    </TouchableHighlight>
  );

  return (
    <ScrollView>
      <Form style={stylezs.container}>
        <FormItem
          style={stylezs.formItem}
          label="categorie_annonce_id"
          onValueChange={(categorie_annonce_id) =>
            setcategorie_annonce_id(categorie_annonce_id)
          }
          asterik
        >
          <Picker
            selectedValue={categorie_annonce_id}
            style={stylezs.red}
            onValueChange={(itemValue, itemIndex) =>
              setcategorie_annonce_id(itemValue)
            }
          >
            {pickerGeneratorCat(cat)}
          </Picker>
        </FormItem>
        <FormItem
          label="type_annonce_id"
          style={stylezs.formItem}
          onValueChange={(type_annonce_id) =>
            settype_annonce_id(type_annonce_id)
          }
          asterik
        >
          <Picker
            selectedValue={type_annonce_id}
            style={stylezs.red}
            onValueChange={(itemValue, itemIndex) =>
              settype_annonce_id(itemValue)
            }
          >
            {pickerGeneratorType(type)}
          </Picker>
        </FormItem>
        <FormItem
          label="membre_id"
          style={stylezs.formItem}
          onValueChange={(membre_id) => setmembre_id(membre_id)}
          asterik
        >
          <Picker
            selectedValue={membre_id}
            style={stylezs.red}
            onValueChange={(itemValue, itemIndex) => setmembre_id(itemValue)}
          >
            {pickerGeneratorMem(mem)}
          </Picker>
        </FormItem>
        <FormItem
          style={stylezs.formItem}
          label="commentaire_id"
          onValueChange={(commentaire_id) => setcommentaire_id(commentaire_id)}
          asterik
        >
          <Picker
            selectedValue={commentaire_id}
            style={stylezs.red}
            onValueChange={(itemValue, itemIndex) =>
              setcommentaire_id(itemValue)
            }
          >
            {pickerGeneratorCom(com)}
          </Picker>
        </FormItem>
        <FormItem
          style={stylezs.formItem}
          label="classement"
          onChangeText={setClassement}
          value={classement}
          asterik
        ></FormItem>
        <FormItem
          style={stylezs.formItem}
          label="titre"
          onChangeText={setTitre}
          value={titre}
          asterik
        ></FormItem>
        <FormItem
          style={stylezs.formItem}
          label="texte"
          onChangeText={setTexte}
          value={texte}
          asterik
        ></FormItem>
        <FormItem
          style={stylezs.formItem}
          label="nbr_vue"
          onChangeText={setNbrVue}
          value={nbr_vue}
          asterik
        ></FormItem>
        <FormItem
          style={stylezs.formItem}
          label="etat"
          onChangeText={setEtat}
          value={etat}
          asterik
        ></FormItem>
        <FormItem
          style={stylezs.formItem}
          label="visible"
          onChangeText={setVisible}
          value={visible}
          asterik
        ></FormItem>
        <FormItem
          style={stylezs.formItem}
          label="publie"
          onChangeText={setPublie}
          value={publie}
          asterik
        ></FormItem>
      </Form>

      {/*<SafeAreaView>
        <Text style={stylezs.text}>categorie_annonce_id</Text>
        <Picker
          selectedValue={categorie_annonce_id}
          style={stylezs.input}
          onValueChange={(itemValue, itemIndex) =>
            setcategorie_annonce_id(itemValue)
          }
        >
          {pickerGeneratorCat(cat)}
        </Picker>

        <Text style={stylezs.text}>classement</Text>
        <TextInput
          name="classement"
          style={stylezs.input}
          onChangeText={setClassement}
          value={classement}
        />
        <Text style={stylezs.text}>commentaire_id</Text>
        <Picker
          selectedValue={commentaire_id}
          style={stylezs.input}
          onValueChange={(itemValue, itemIndex) => setcommentaire_id(itemValue)}
        >
          {pickerGeneratorCom(com)}
        </Picker>

        <Text style={stylezs.text}>membre_id</Text>
        <Picker
          selectedValue={membre_id}
          style={stylezs.input}
          onValueChange={(itemValue, itemIndex) => setmembre_id(itemValue)}
        >
          {pickerGeneratorMem(mem)}
        </Picker>

        <Text style={stylezs.text}>type_annonce_id</Text>
        <Picker
          selectedValue={type_annonce_id}
          style={stylezs.input}
          onValueChange={(itemValue, itemIndex) =>
            settype_annonce_id(itemValue)
          }
        >
          {pickerGeneratorType(type)}
        </Picker>
        <Text style={stylezs.text}>titre</Text>
        <TextInput
          name="titre"
          style={stylezs.input}
          onChangeText={setTitre}
          value={titre}
        />
        <Text style={stylezs.text}>texte</Text>
        <TextInput
          name="texte"
          style={stylezs.input}
          onChangeText={setTexte}
          value={texte}
        />
        <Text style={stylezs.text}>nbr_vue</Text>
        <TextInput
          name="nbr_vue"
          style={stylezs.input}
          onChangeText={setNbrVue}
          value={nbr_vue}
        />
        <Text style={stylezs.text}>etat</Text>
        <TextInput
          name="etat"
          style={stylezs.input}
          onChangeText={setEtat}
